description:
Eric Hoffman discovers that his deceased father was the world's most hated super-villain, Abyss. So he assumes his father's identity and goes about setting right all his father's wrongs, with mixed success. 

Written by Kevin Rubio, creator of parody film web phenomenon TROOPS and the creative team behind comedy smash Star Wars: Tag and Bink. Illustrated by Lucas Marangon (R.I.P.D., Star Wars: Tag and Bink).


